    [],nt"revision_timestamp": "2015-12-09T02:44:01.925196",nt"name": "zimmerman72-sediment-data-from-the-continental-rise",nt"isopen":
    false,nt"url": null,nt"notes": "Short cores were collected on the continental
    rise off Georges Bank. The character of the sediments and measured bottom currents
    show that the Western Boundary Undercurrent is a significant factor in sediment
    transport and deposition along the east coast continental rise. Size data for the
    sand and mud fractions were estimated by the compilers by subtracting the percent
    carbonate (composed largely of sand-sized planktonic foraminifera) from the coarse
    fraction. Silt and clay were not differentiated; the fine fraction is reported as
    mud.",nt"license_title": null,nt"extras": [{ntt"key": "bbox-east-long",ntt"value":
